import React from "react";
import styled from "styled-components";
const Ul = styled.ul`
list-style: none;
display: flex;
flex-flow: row nowrap;
@media(max-width: 1000px){
        display:none;
        flex-flow:column nowrap;
        position: fixed;
        transform: ${({open}) => open? 'translateX(0)': 'transale'}
        flex-flow: column nowrap;
        top: 0;
        right: 0;
        height: 25vh;

}
`;

function Content() {
  return (
    <>
      <Ul>
        <li className="m-3">
          <a>Register</a>
        </li>
        <li className="m-3">
          <a>Timeline</a>
        </li>
        <li className="m-3">
          <a>Guidlines</a>
        </li>
        <li className="m-3">
          <a>Contact us</a>
        </li>
      </Ul>
    </>
  );
}

export default Content;
